.blog{
    width:              100%;
    display:            flex;
    min-height: 100vh;
    flex-direction:     column;
    justify-content:    center;
    align-items:        center;
    background-color:   inherit;
    color:              #444950;
    font-family:        'Poppins', sans-serif;

    &__heading{
        text-align:         center;
        margin:             0 50px 36px 50px;
    }

    

    &__post_container{
        display:            grid;
        row-gap:            36px;
        column-gap:         29px;
        margin:             0 30px;
        width:              80%;
    }
    
    &__image{
        margin-bottom:      27px;
        
        img{
            width:              100%;
            height:             auto;
        }
    }
    
    &__post_card{
        background-color:   #fdfdfd;
        display:            flex;
        flex-direction:     column;
        justify-content:    space-between;
        box-shadow: rgba(0, 0, 0, 0.15) 0px 5px 15px 0px;
    	cursor:		    pointer;
    }

    &__post_title{
        font-family:        inherit;
        font-size:          16px;
        letter-spacing:     .36px;
        line-height:        150%;
        margin:             0 16px 16px 16px;

        p{
            font-size:          16px;
            font-weight:        400;
        }
    }

    &__line{
        height:             2px;
        width:              30%;
        margin:             auto 16px 10px 16px;
        background-color:   #444950;
	    transition:	    0.2s width ease;
    }

    &__date{
        font-size:          0.7rem;
        letter-spacing:     .28px;
        line-height:        150%;
        opacity:            0.75;
        margin:             0 16px 10px 16px;
        bottom:             0;
    }
}

sources.style/modules/contact/contact.scss:
.contact{
    width:              100%;
    min-height:         100vh;
    display:            flex;
    flex-direction:     column;
    justify-content:    center;
    align-items:        center;
    font-family:        'Poppins', sans-serif;
    color:              #344854;

    &__wrapper{
        display:            flex;
        flex-direction:     column;
        width:              80%;
    }

    &__form{
	margin:		0 0 36px 0;
        form{
            display:            flex;
            flex-direction:     column;
            align-items:        center;
        }
    }
    
    .form__group{
        display:            flex;
        flex-direction:     column;
        align-items:        center;
        margin-top:         16px;
        width:              100%;
        box-shadow:         rgba(0, 0, 0, 0.15) 0px 5px 15px 0px;
    }
    
    .form__label{
        font-size:          16px;
        margin:             16px 0 0.7rem 0;
    }
    
    .form__field{
        font-size:          0.7rem;
        font-family:        inherit;
        width:              100%;
        height:             36px;
        outline:            none;
        border:             none;

        &--msg{
            height:             72px
        }
    }

    .btn{
        height:             50px;
        width:              150px;
        margin:             32px 0;
        border:             none;
        outline:            none;
        color:		    #f0f0f0;
        background-color:   #344854;  
    	cursor:		    pointer;

	&:hover{
	    color:		white;
	}
    }

    &__social{
        display:            flex;
        justify-content:    space-around;
        margin:             16px;
    }

    svg{
        opacity:            0.75;
        margin:             0 16px;
    }

    
    @media screen and (min-width: 600px){
	.form__group{
	    width:		75%;
	}	         

	.contact__social{
	    justify-content:	center;
	}

    }


    @media screen and (min-width: 950px){
    	.form__group{
	    width: 		60%;
	}
    }

}

